import React from "react";

export default function GroupCreation() {
    return (
        <div>
            <h1>Création de votre colocation</h1>
            <div>
                <p>Nom de votre colocation: </p>
                <input type="text"/>
                <button>Créer</button>
            </div>
        </div>
    )
}
